const worldRadius = 1.5

export const world = {
  grass: { geometry: [worldRadius, 1, 0.3, 25], colour: '#5AAB61' }, // cylinder: [radiusTop, radiusBottom, height, radialSegments]
  earth: { geometry: [worldRadius + 1.5, 1, 0.68, 9], colour: '#8a817c' }, // cylinder: [radiusTop, radiusBottom, height, radialSegments]
}
